sealed class PubkyException(message: String): Exception(message) {
        
        class Auth(message: String) : PubkyException(message)
        
        class Request(message: String) : PubkyException(message)
        
        class Build(message: String) : PubkyException(message)
        
        class InvalidInput(message: String) : PubkyException(message)
        
        class Network(message: String) : PubkyException(message)
        
        class Unknown(message: String) : PubkyException(message)
        

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<PubkyException> {
        override fun lift(error_buf: RustBuffer.ByValue): PubkyException = FfiConverterTypePubkyError.lift(error_buf)
    }
}

public object FfiConverterTypePubkyError : FfiConverterRustBuffer<PubkyException> {
    override fun read(buf: ByteBuffer): PubkyException {
        
            return when(buf.getInt()) {
            1 -> PubkyException.Auth(FfiConverterString.read(buf))
            2 -> PubkyException.Request(FfiConverterString.read(buf))
            3 -> PubkyException.Build(FfiConverterString.read(buf))
            4 -> PubkyException.InvalidInput(FfiConverterString.read(buf))
            5 -> PubkyException.Network(FfiConverterString.read(buf))
            6 -> PubkyException.Unknown(FfiConverterString.read(buf))
            else -> throw RuntimeException("invalid error enum value, something is very wrong!!")
        }
        
    }

    override fun allocationSize(value: PubkyException): Int {
        return 4
    }

    override fun write(value: PubkyException, buf: ByteBuffer) {
        when(value) {
            is PubkyException.Auth -> {
                buf.putInt(1)
                Unit
            }
            is PubkyException.Request -> {
                buf.putInt(2)
                Unit
            }
            is PubkyException.Build -> {
                buf.putInt(3)
                Unit
            }
            is PubkyException.InvalidInput -> {
                buf.putInt(4)
                Unit
            }
            is PubkyException.Network -> {
                buf.putInt(5)
                Unit
            }
            is PubkyException.Unknown -> {
                buf.putInt(6)
                Unit
            }
        }.let { /* this makes the `when` an expression, which ensures it is exhaustive */ }
    }

}




